import { Link } from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <button className='Adbutton'>Admin</button>
        <button className='Empbutton'>Emp</button>
      </header>
    </div>
  );
}

export default App;
